import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button'
import Typography from '@material-ui/core/Typography'
import Toolbar from '@material-ui/core/Toolbar';
import logo from '../../photos/Group.png'

import HelpIcon from '@material-ui/icons/Help';


const useStyles = makeStyles((theme) => ({
  root: {
      background: 'linear-gradient(#ac1c13, #bf4342)',
      paddingTop: '5px',
      paddingBottom: '5px'
  },
  linkBrand: {
    flexGrow: 1,
    fontFamily: '-apple-system-body, BlinkMacSystemFont, sans-serif',
    fontWeight: '100',
    [theme.breakpoints.down('xs')]: {
      display: 'none',
    }
  },
  signin: {
    width: "210px",
    height: "40px",
    cursor: "pointer",
    paddingLeft: "5px",
  },
  learnmore: {
    width: "210px",
    height: "40px",
    cursor: "pointer",
    color: "black",
    background: "white",
    fontFamily: 'sans-serif',
    textTransform: "none",
    borderRadius: '7px',
    fontWeight: '500px',
    '&:hover': {
      background: 'black',
      color: 'white',
 },   
  }
}
));

export default function Component(props) {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.root}>
      <Toolbar>
        <div style={{width: "100%", display: "flex", justifyContent: "space-between"}}>
          <img src={logo} alt="Logo" width={300} height={70} />
          <div style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
            <Button className={classes.learnmore}>
              <HelpIcon style={{fontSize: "medium", paddingRight: '5px'}}/>
              <Typography style={{fontWeigth: '500px'}}>Learn More</Typography>
            </Button>
            <div id="appleid-signin" className={classes.signin} font-weight='100' data-color="black" data-border="false" data-type="sign-in"></div>
            <script type="text/javascript" src="https://appleid.cdn-apple.com/appleauth/static/jsapi/appleid/1/en_US/appleid.auth.js"></script>
          </div>
        </div>
      </Toolbar>
    </AppBar>
  );
}
